INSERT INTO Translation VALUES('f4a2b3c4-4444-4567-890a-bcdef0123456','If F(x) = x³/3, what is ∫[0,2] x² dx?','אם F(x) = x³/3, מה הוא ∫[0,2] x² dx?');
