INSERT INTO Translation VALUES('faa2b3c4-aaaa-4567-890a-bcdef0123456','The Fundamental Formula states that if F is an antiderivative of f, then which statement is true?','הנוסחה היסודית קובעת שאם F היא פונקציה קדומה של f, אז איזה מהטענות נכונה?');
INSERT INTO Translation VALUES('faa2b3c4-aaaa-4567-890a-bcdef0123458','The definite integral equals the difference of antiderivative values at the bounds','האינטגרל המסוים שווה להפרש ערכי הפונקציה הקדומה בקצוות');
INSERT INTO Translation VALUES('faa2b3c4-aaaa-4567-890a-bcdef0123459','The definite integral equals the sum of antiderivative values at the bounds','האינטגרל המסוים שווה לסכום ערכי הפונקציה הקדומה בקצוות');
INSERT INTO Translation VALUES('faa2b3c4-aaaa-4567-890a-bcdef012345a','The definite integral equals the product of antiderivative values at the bounds','האינטגרל המסוים שווה למכפלה של ערכי הפונקציה הקדומה בקצוות');
